//INICIO función realizarDeposito
function realizarRetiro() {
  var cantidadRetirar = document.getElementById('cantidadRetirar').value;

  // Validar la cantidad a retirar
  if (!validarCantidadRetirar(cantidadRetirar)) {
    //Limpiando el campo por si coloca un valor incorrecto, como negativo
    document.getElementById('cantidadRetirar').value = '';
    return;
  }

  // Aquí continúa la lógica para página retiro
  // Obtener el saldo actual del localStorage, para validarlo y poder restarle la cantidad a retirar
  var saldoActual = parseFloat(localStorage.getItem('saldo'));
  var cantidad = parseFloat(document.getElementById('cantidadRetirar').value);
  // Validar que la cantidad sea un número válido
  if (isNaN(cantidad) || cantidad <= 0) {
    //alerta que se lanza si en el campo está vacio, cero o negativo
    // Mostrar el mensaje de error del campo validado
    Swal.fire({
      title: 'Por favor ingresa una cantidad válida.',
      text: errors.cantidadRetirar[0],
      // indica la posición (0) del mensaje que se debe mostrar, al romoperse alguna de las 2 reglas que tiene el campo. Como solo se puede romper 1 a la vez. Siempre se debe llamar a la posición 0 de la matriz error contrasena
      icon: 'error',
      backdrop: false,
    });
    return;
  }

  // Verificar si la cantidad a retirar es mayor que el saldo disponible
  if (cantidad > saldoActual) {
    Swal.fire({
      title: 'Saldo insuficiente',
      text: 'No tienes suficiente saldo en tu cuenta bancaria para realizar este retiro.',
      icon: 'error',
      backdrop: false,
    });
    // limpiando input para que vuelva a intentarlo el usuario
    document.getElementById('cantidadRetirar').value = '';
    return;
  }

  // Al saldo actual del localStorage se le resta la cantidad a retirar
  var nuevoSaldo = saldoActual - cantidad;
  // Actualizar el saldo en el localStorage
  localStorage.setItem('saldo', nuevoSaldo.toString());
  // Mostrar un mensaje de confirmación
  // Mostrar el mensaje de error del campo validado
  Swal.fire({
    title: 'Éxito',
    text: 'Se ha retirado $' + cantidad + ' . Nuevo saldo: $' + nuevoSaldo + ' .',
    // indica la posición (0) del mensaje que se debe mostrar, al romoperse alguna de las 2 reglas que tiene el campo. Como solo se puede romper 1 a la vez. Siempre se debe llamar a la posición 0 de la matriz error contrasena
    icon: 'success',
    backdrop: false,
  });
  //alert('Se ha retirado $' + cantidad + ' . Nuevo saldo: $' + nuevoSaldo + ' .');
  document.getElementById('cantidadRetirar').value = '';
  //Almacenando transacción en el historial
  var nuevaTransaccion = {
    concepto: 'retiro',
    fecha: obtenerFechaActual(), // Función para obtener la fecha actual
    valor: cantidad,
  };
  var historial = JSON.parse(localStorage.getItem('historial')) || [];
  historial.push(nuevaTransaccion);
  localStorage.setItem('historial', JSON.stringify(historial));

    // Generar el PDF
    generarPDFRetiro(cantidadRetirar, saldoActual, nuevoSaldo);

  //PARA QUE SE ACTUALICE EL SALDO EN EL ENCABEZADO AL HACER LA TRANSACCIÓN
  // Obtener el saldo actual del localStorage
  var saldoActual = parseFloat(localStorage.getItem('saldo'));
  //asignación del saldo al encabezado
  document.getElementById('saldo-encabezado').innerHTML = 'El N° cuenta es 0987654321, el saldo actual es $ ' + saldoActual;
}
//FIN función realizarDeposito

function obtenerFechaActual() {
  var fecha = new Date();
  var dia = fecha.getDate();
  var mes = fecha.getMonth() + 1; // Se agrega 1 porque los meses comienzan desde 0
  var año = fecha.getFullYear();
  // Formatear la fecha en el formato dd-mm-yyyy
  return (dia < 10 ? '0' : '') + dia + '-' + (mes < 10 ? '0' : '') + mes + '-' + año;
}

